import React from 'react';
import yoribogoLogo from '../../yoribogologo.png'; 

function StartPage() {
    return (
        <div className = "container">
            <img src = {yoribogoLogo} className="logo" /> 
            <button className='orange-btn'>로그인</button>
            <a href='#' className='signup'>회원가입</a>
        </div>
    );
}

export default StartPage;
